// Fonction d'activation du plugin
function cod_activation()
{
    global $wpdb;
    $table_name = $wpdb->prefix . 'cod';

    $charset_collate = $wpdb->get_charset_collate();

    $sql = "CREATE TABLE $table_name (
        id mediumint(9) NOT NULL AUTO_INCREMENT,
        nomProduit varchar(255) NOT NULL,
        taille varchar(255) NOT NULL,
        color varchar(255) NOT NULL,
        nomPrenom varchar(255) NOT NULL,
		telephone varchar(255) NOT NULL,
        city varchar(255) NOT NULL,
        address varchar(255) NOT NULL,
        status varchar(255) NOT NULL,
        PRIMARY KEY  (id)
    ) $charset_collate;";

    require_once(ABSPATH . 'wp-admin/includes/upgrade.php');
    dbDelta($sql);
}
register_activation_hook(__FILE__, 'cod_activation');

// Fonction de dÃ©sactivation du plugin
function cod_desactivation()
{
    global $wpdb;
    $table_name = $wpdb->prefix . 'cod';

    $wpdb->query("DROP TABLE IF EXISTS $table_name");
}
register_deactivation_hook(__FILE__, 'cod_desactivation');
function COD_add_menu_page()
{
    add_menu_page(
        __('COD', 'textdomain'),
        'COD',
        'manage_options',
        'COD',
        '',
        'dashicons-products',
        8
    );
    add_submenu_page(
        'COD',
        __('Books Shortcode Reference', 'textdomain'),
        __('Shortcode Reference', 'textdomain'),
        'manage_options',
        'COD',
        'COD_callback'
    );
}
add_action('admin_menu', 'COD_add_menu_page');

