function delete()
{
    ob_start();
    global $wpdb;
    $table_name = $wpdb->prefix . 'cod';

    $id = $_POST['id_contact'];

    $wpdb->get_results("DELETE FROM $table_name WHERE id = $id");

    if (isset($_SERVER['HTTP_REFERER'])) {
        $referer = wp_get_referer();
        wp_redirect($referer);
        return ob_get_clean();
    }
}
add_action('admin_post_delete', 'delete');
function changeStatus()
{
    ob_start();
    global $wpdb;
    $table_name = $wpdb->prefix . 'cod';

    $id = $_POST['id_contact'];
    $status = $_POST['status'];

    $wpdb->get_results("UPDATE $table_name SET `status` = '$status' WHERE `id` = $id");

    if (isset($_SERVER['HTTP_REFERER'])) {
        $referer = wp_get_referer();
        wp_redirect($referer);
        return ob_get_clean();
    }
}
add_action('admin_post_changeStatus', 'changeStatus');

