                                <input type="hidden" name="color" value="${colorValue}">
                                <input type="hidden" name="taille" value="${tailleValue}">
                                <div class="labelInput">
                                    <label for="FullName">Full Name</label>
                                    <input type="text" id="FullName" name="FullName" required>
                                </div>
                                <div class="labelInput">
                                    <label for="Telephone">Telephone</label>
                                    <input type="text" id="Telephone" name="Telephone" required>
                                </div>
                                <div class="labelInput">
                                    <label for="City">City</label>
                                    <input type="text" id="City" name="City" required>
                                </div>
                                <div class="labelInput">
                                    <label for="Address">Address</label>
                                    <input type="text" id="Address" name="Address" required>
                                </div>
                                <input type="hidden" name="action" value="saveCOD">
                                <button title="Buy Now" type="submit">Buy Now</button>
                            </form>`
                formBuyNowCOD.innerHTML= formCOD
                formBuyNowCOD.setAttribute('style','display:block')
            }
        }
    </script>
    <?php
}
add_shortcode('COD', 'COD' );
function saveCOD()
{
    global $wpdb;
    $table_name = $wpdb->prefix . 'cod';

    $nomProduit = $_POST['nomProduit'];
    $color = $_POST['color'];
    $taille = $_POST['taille'];
    $FullName = $_POST['FullName'];
    $Telephone = $_POST['Telephone'];
    $City = $_POST['City'];
    $Address = $_POST['Address'];

    $wpdb->insert(
        $table_name,
        array(
            'nomProduit' => $nomProduit,
            'color' => $color,
            'taille' => $taille,
            'nomPrenom' => $FullName,
            'telephone' => $Telephone,
            'city' => $City,
            'address' => $Address,
            'status' => "New"
        )
    );
    wp_redirect(home_url(''));
}
add_action('admin_post_saveCOD', 'saveCOD');
